/**
 * Selects a given item from a list in a given Autocomplete instance
 * This helper yields the autocomplete element.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="basicUsage"]')
 *      .then(selectItem('Apple'))
 * ```
 */
export var selectItem = function (item) { return function ($element) {
    cy.wrap($element)
        .find('input')
        .type(item)
        .submit();
    return cy.wrap($element);
}; };
